import React from "react";

function Home() {
  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h1>Trang chủ React</h1>
      <p>Đây là trang chủ của ứng dụng React.</p>
    </div>
  );
}

export default Home;
